var updateAvailability = () => {
  c2.isAvailable = c2term.level > 0;
  c3.isAvailable = c3term.level > 0;
  q3.isAvailable = q3term.level > 0;
};

var tick = (elapsedTime, multiplier) => {
  let dt = BigNumber.from(elapsedTime * multiplier);
  let bonus = theory.publicationMultiplier;

  if (updateT_flag) {
    sum = getC1(c1.level) + (c2term.level > 0 ? getC2(c2.level) : 0) + (c3term.level > 0 ? getC3(c3.level) : 0);
    updateT();
    updateT_flag = false;
  }

  let vq1 = getQ1(q1.level);

  q += dt * qdot;

  currency.value += dt * bonus * vq1.pow(getQ1Exp(q1exp.level)) * getQ2(q2.level) * rhoBoost * q.pow(getQExp(qexp.level));
  theory.invalidateTertiaryEquation();
};
var postPublish = () => {
  q = BigNumber.ONE;
  qdot = BigNumber.ZERO;
  updateT_flag = true;
  theory.invalidateTertiaryEquation();
};
var setInternalState = (state) => {
  let values = state.split(" ");

  updateT_flag = true;
};
var getPrimaryEquation = () => {
  theory.primaryEquationHeight =diffterm.level > 0 ? 200 : 120;
  theory.primaryEquationScale = 0.9;
  let result = "";
  result += "T_{2^k+i}\\left\\{ \\begin{array}{llll}\\frac{1}{3}(2^{2k+1}+1)  & \\text{if } i = 0,  \\\\ T_{2^k}+2T_i + T_{i+1}-1 & \\text{if } i = 1,..., 2^k - 1. \\end{array}\\right\\}\\\\\\\\ ";
  result += "\\qquad\\qquad\\qquad\\qquad\\qquad\\quad \\dot{\\rho} = q_1";

  if (q1exp.level > 0) result += `^{${getQ1Exp(q1exp.level).toString(3)}}`;

  result += "q_2";
  if (diffterm.level > 0) result += "q";
  if (qexp.level > 0) result += `^{${getQExp(qexp.level).toString(4)}}`;
  result += "A";

  result += "\\\\\\ ";

  if (diffterm.level > 0) {
    result += "\\\\\\\\ ";
    result += "\\qquad\\qquad\\dot{q} = ";
    if (diffterm.level === 1) result += "(T_n - T_{n-1})";
    if (diffterm.level === 2) result += "\\max(T_n - T_{n-1})";
    if (q3term.level > 0) result += "(\\min(T_n, T_{5000})^{4})^{q_3}";
  }

  // result += "A\\\\\\\\";
  // if (diffterm.level === 0) result += "A = \\frac{500^{\\lfloor log_2(n-1) \\rfloor}T_n^{2.5}}{10}";
  // else if (diffterm.level === 1) result += "A = \\frac{500^{\\lfloor log_2(n-1) \\rfloor}T_n^{2.5}(T_n-T_{n-1})}{10}";
  // else if (diffterm.level === 2) result += "A = \\frac{500^{\\lfloor log_2(n-1) \\rfloor}T_n^{2.5}\\max(T_n-T_{n-1})}{10}";

  return result;
};
var getSecondaryEquation = () => {
  theory.secondaryEquationHeight = 50;
  let result = "\\begin{matrix}";
  result += "A = 10^{\\lfloor log_2(n) \\rfloor}T_n";
  if (q3term.level > 0) result += "^{0.7+q_3}";
  result += `\\\\\\\\ n = c_1`;
  if (c2term.level > 0) result += " + c_2";
  if (c3term.level > 0) result += " + c_3";

  result += ",";

  result += "\\quad" + theory.latexSymbol + "=\\max\\rho^{0.1}";

  result += "\\end{matrix}";
  return result;
};
var getTertiaryEquation = () => {
  let result = "\\begin{matrix}";

  result += "n = ";
  result += sum.toString(0);

  result += ",&A = ";
  result += rhoBoost.toString(0);

  if (diffterm.level > 0) {
    result += ",&q = ";
    result += q.toString();
  }
  result += "\\\\ {}\\end{matrix}";
  return result;
};
function updateT() {
  if (sum < BigNumber.TWO) {
    rhoBoost = sum;
    return;
  }
  t_n = T(sum);
  let t_nm1 = T(sum - 1);
  maxDiff = Math.max(t_n - t_nm1, maxDiff, ...max.slice(0, sum - 1));

  rhoBoost = BigNumber.TEN.pow(BigNumber.from(Math.floor(Math.log2(sum)))) * BigNumber.from(t_n).pow(q3term.level > 0 ? BigNumber.from(0.6) + getQ3(q3.level) : BigNumber.ONE);

  if (diffterm.level === 1) qdot = BigNumber.from(t_n - t_nm1);
  else if (diffterm.level === 2) qdot = BigNumber.from(maxDiff);
  else qdot = BigNumber.ZERO;

  qdot *= BigNumber.from(Math.min(t5000, t_n) ** 4).pow(q3term.level > 0 ? getQ3(q3.level) : BigNumber.ZERO);
}
function T(n) {
  if (n === 1) return 0;
  let log2N = Math.log2(n);
  if (log2N % 1 === 0) return (2 ** (2 * log2N + 1) + 1) / 3;
  let i = n - 2 ** Math.floor(log2N);
  return T(2 ** Math.floor(log2N)) + 2 * T(i) + T(i + 1) - 1;
}

var getPublicationMultiplier = (tau) => tau.pow(1.245) / BigNumber.from(20);
var getPublicationMultiplierFormula = (symbol) => "\\frac{{" + symbol + "}^{1.245}}{20}";
var getTau = () => currency.value.pow(0.1);
var getCurrencyFromTau = (tau) => [tau.max(BigNumber.ONE).pow(10), currency.symbol];
var get2DGraphValue = () => currency.value.sign * (BigNumber.ONE + currency.value.abs()).log10().toNumber();

let getVarVal = (lvl, stepLength) => (((lvl - (lvl % stepLength)) / stepLength - 1) / 2 + 1) * (lvl - (lvl % stepLength)) + (lvl % stepLength) * Math.ceil(lvl / stepLength);

var getQ1 = (level) => Utils.getStepwisePowerSum(level, 2, 10, 0);
var getQ2 = (level) => BigNumber.TWO.pow(level);
var getQ3 = (level) => level * BigNumber.from(0.01);
var getC1 = (level) => Utils.getStepwisePowerSum(level, 5, 10, 1);
var getC2 = (level) => BigNumber.from(getVarVal(level, 15));
var getC3 = (level) => BigNumber.from(getVarVal(level, 20));
var getQ1Exp = (level) => BigNumber.from(1 + 0.017 * level);
var getQExp = (level) => BigNumber.from(1 + 0.0025 * level);

init();
